import React from "react";
import {
  ContactContainer,
  LinkContainer,
  TwitterIcon,
  LinkedInIcon,
  GithubIcon,
  FacebookIcon,
  FacebookText,
  LinkedInText,
  TwitterText,
  GithubText,
} from "./Contact.style";
import { motion } from "framer-motion";
const Contact = () => {
  return (
    <ContactContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <FacebookIcon>
          <i
            style={{
              fontSize: "25px",
              lineHeight: "60px",
            }}
            class="fab fa-facebook-f"
          ></i>
        </FacebookIcon>
        <FacebookText>Facebook</FacebookText>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <GithubIcon>
          <i
            class="fab fa-github"
            style={{ fontSize: "25px", lineHeight: "60px" }}
          ></i>
        </GithubIcon>
        <GithubText>Github</GithubText>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <LinkedInIcon>
          <i
            style={{ fontSize: "25px", lineHeight: "60px" }}
            class="fab fa-linkedin-in"
          ></i>
        </LinkedInIcon>
        <LinkedInText>LinkedIN</LinkedInText>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <TwitterIcon>
          <i
            style={{ fontSize: "25px", lineHeight: "60px" }}
            class="fab fa-twitter"
          ></i>
        </TwitterIcon>
        <TwitterText>Twitter</TwitterText>
      </LinkContainer>
    </ContactContainer>
  );
};
export default Contact;
